// Dependencies.
import React from 'react';

// Component 'AboutMe'.
function AboutMe() {
    return (
        // AboutMe Container.
        <>
            <div id="AboutMe">
                <div className="container-fluid text-center">
                    {/* My Profile Picture */}
                    <img id="iamshawn-profile2" className="img-thumbnail" alt="iamshawn2.jpg" src="../../assets/misc/iamshawn2.jpg" />
                    {/* About Me Context */}
                    <div id="AboutMeContext">
                        <p className="text-white lead">
                            Thank you for stopping by, and welcome to my official website. My name is Shawn Luther, and I am
                            a web developer, with a passion, for creation. Since I was a little kid I have always taken
                            interest at the complexities of the world around me, especially when it came to software.
                            I played a lot of video games growing up, and always wanted to know how people did it.
                            I remember at the age of just five and noticing how the characters in the games I
                            played had weird jolting idle animations,
                        </p>
                    </div>
                </div>
            </div>
        </>
    );
}

// Do export.
export default AboutMe;
